import React from 'react';
import './styles/styles.css'; // Importing CSS for styling
import Recorder from './Recorder'; // Assuming Recorder.js is in the same directory
import MeetingNote from './MeetingNote'; // Assuming MeetingNote.js is in the same directory

function MeetingPage() {
    return (
        <div className="meeting-page-container">
            <div className="recorder">
                <Recorder />
            </div>
            <div className="meeting-note">
                <MeetingNote />
            </div>
        </div>
    );
}

export default MeetingPage;
